  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:23.417623\",\n\t\"name\": \"hailstone-reservoir-feasibility-study-hailstone-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study covers the water quality in
  the Hailstone Reservoir that has been severely impacted by up-gradient saline seeps
  that contain trace elements. Due to the high concentrastions of salinty in the Hailstone
  Reservoir, the USFWS has determined the saline and selenium reservoir in the basin
  must be removed to protect the waterfowl, shorebirds, and other wildlife in the
  refuge.This report discusses the feasible options for saline water removal and salt
  management from the Hailstone reservoir basin and options to create a flow-through
  surface water system.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
